description:
Ингредиенты:
Творог - 500 г;
Манка - 3,5 ст.л;
Яйцо - 2 шт;
Сметана - 50 г (4 ст.л.);
Сахар - 2 ст.л;
Соль - щепотка;
Масло сливочное (растопленное) ~ 50 г;
Масло сливочное (для смазки формы) ~ 30 г;

Процесс приготовления:
В кастрюле смешиваем все ингредиенты, выкладываем в форму для запекания, смазанную сливочным маслом, а сверху поливаем растопленным сливочным маслом.
Запекаем в разогретой до 200 градусов духовке 20-25 минут.

