Ингредиенты:
Мука - 800 г;
Вода (тёплая) - 400 мл;
Дрожжи (сухие) - 10 г;
Сахар - 40 г;
Соль - 10 г;
Баранина - 400 г;
Говядина - 400 г;
Лук (репчатый) - 200 г;
Чеснок - 30 г;
Зира - 4 г;
Чёрный перец - 5 г;
Соль - 15-20 г;
Масло (растительное) - 600-700 мл.

Процесс приготовления:
1. Муку просеиваем через сито в глубокую ёмкость;
2. Размешиваем в стакане тёплой воды сахар и дрожжи. Выливаем полученную смесь в ёмкость с мукой.
3. Добавляем соль и растительное масло. Тщательно вымешиваем, возвращаем в глубокую ёмкость, закрываем пищевой плёнкой и оставляем «отдохнуть» на 15-20 минут в тёплом месте.
4. Мясо (говядину и баранину) и лук пропускаем через мясорубку. Выдавливаем 6-7 зубчиков чеснока. Добавляем зиру, перец  и соль.
5. Из теста формируем шарики, раскатываем скалкой. В центр каждой лепёшки выкладываем фарш и формируем беляши, оставляя сверху небольшое отверстие, как показано на видео.
6. В сковороде разогреваем растительное масло. Аккуратно выкладываем беляши в разогретое масло, отверстием вниз. Обжариваем с двух сторон до появления румяной золотистой корочки.
7. Выкладываем на бумажное полотенце, чтобы убрать излишки масла и наслаждаемся!

