Ингредиенты:
Говядина - 500 г;
Картофель - 500 г;
Капуста - 500 г;
Свёкла - 1 шт (крупная);
Морковь - 1 шт;
Лук репчатый - 1 шт;
Чеснок - 5 зуб;
Лавровый лист - 2 шт;
Сахар - по вкусу;
Соль - по вкусу;
Перец горошком - 5 шт;
Уксус столовый - 30 мл;
Зелень/Сметана - для подачи;

Приготовление:
Наполняем кастрюлю холодной водой, погружаем мясо на кости, подсаливаем и варим на сильном огне до снятия пены. Далее варим на среднем огне до готовности.
На сковороде разогреваем растительное масло;
Нарезаем лук, отправляем на сковороду и обжариваем до тех пор, пока он не станет прозрачным;
Натираем морковь на крупной тёрке, отправляем в сковороду и обжариваем вместе с луком;
Натираем свёклу на крупной тёрке, отправляем в сковороду, добавляем немного столового уксуса и обжариваем вместе с луком и морковью, периодически помешивая. Добавляем 100 мл горячего бульона, накрываем крышкой, томим пару минут и убираем с огня;
Шинкуем капусту, картофель нарезаем небольшими брусочками, измельчаем чеснок;
Достаём из кастрюли кусок мяса и закидываем капусту в бульон, добавляем соль и сахар по вкусу. Как вода закипит, высыпаем картофель в кастрюлю;
Отделяем мясо от кости, нарезаем на кусочки желаемого размера и возвращаем в бульон;
За несколько минут до готовности, добавляем зажарку, варим ещё 5 минут, после чего добавляем лавровый лист, перец горошком и солим по вкусу. Доводим до кипения и добавляем мелко нарезанный чеснок;
После этого, накрываем крышкой и варим ещё 5 минут на слабом огне;
Рекомендую подавать к столу со сметаной, свежей зеленью, салом и гренками.

