Ингредиенты теста для блинов с красной рыбой:

Мука — 150 г;
Яйца — 2 шт.;
Кефир — 500 мл;
Молоко — 100 мл;
Масло растительное — 4 ст. л.;
Сахар — 3 ч. л.;
Соль — 1 ч. л.;
Сода — 1/2 ч. л.
Ингредиенты для начинки:

Сыр Рикотта — 300 г;
Красная рыба слабосоленая — 200 г;
Огурец свежий — 1 шт.;
Укроп — 1 ст. л.;
Соль — ½ ч.л.
Приготовление блинов с красной рыбой:

В миску разбиваем яйца, высыпаем соль и сахар, перемешиваем венчиком. Просеиваем в яичную смесь муку и вливаем 250 мл кефира, смешиваем до густого теста.

В тесто выливаем остатки кефира, высыпаем соду и продолжаем смешивать. Вливаем в тесто растительное масло и молоко, перемешиваем.

Оставляем тесто на 15-20 минут под полотенцем в тепле. Для начинки удаляем семена из огурца и нарезаем его на мелкие кубики.

Аналогично огурцу нарезаем слабосоленую рыбу, шинкуем укроп. Выкладываем огурец, рыбу и укроп в миску с сыром, солим и перемешиваем.

В сковороде обжариваем блины классическим методом.

 На край каждого блина кладем начинку и заворачиваем в конвертик. 
Приятного аппетита ?

Здоровый образ жизни (ЗОЖ) — это образ жизни человека, который помогает сохранить здоровье и снизить риск неинфекционных заболеваний путём контроля над поведенческими факторами риска.

Основные аспекты здорового образа жизни включают:

отказ от табака и употребления алкоголя;

рациональное питание;

физическую активность (физические упражнения, спорт и тому подобное);

укрепление психического здоровья.

Принципы образа жизни обычно закладываются в молодом возрасте, поэтому для формирования здорового образа жизни важным является формирование здорового образа в этом возрасте — привычки, сформировавшиеся в молодости, зачастую сохраняются и во взрослой жизни.

Предлагаю Вашему вниманию классную идею вкусного, сытного, а главное быстрого ужина!
